import React from "react";
import { Typography, Box, Container, Button } from "@mui/material";

// UploadedFiles component to display uploaded files with share and like buttons
const UploadedFiles = ({ files }) => {
  return (
    <div>
      {files.map((file, index) => (
        <Box key={index} sx={{ display: "flex", alignItems: "center", gap: 2 }}>
          <Typography>{file.name}</Typography>
          <Button
            variant="contained"
            color="primary"
            onClick={() => handleShare(file)}
          >
            Share
          </Button>
          <Button
            variant="contained"
            color="secondary"
            onClick={() => handleLike(file)}
          >
            Like
          </Button>
        </Box>
      ))}
    </div>
  );
};

// Dummy functions for handling share and like actions
const handleShare = (file) => {
  console.log("Share file:", file);
};

const handleLike = (file) => {
  console.log("Like file:", file);
};

function Home() {
  // Dummy data for uploaded files
  const uploadedFiles = [
    { name: "File 1.pdf", url: "/assets/file1.pdf" },
    { name: "File 2.docx", url: "/assets/file2.docx" },
    // Add more files as needed
  ];

  return (
    <Container sx={{ maxWidth: "100%", padding: "0" }}>
      <Box
        sx={{
          marginTop: "50px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography
          variant="h1"
          sx={{
            fontFamily: "Rubik",
            fontSize: "6rem",
            color: "lightblack",
          }}
        >
          Welcome To SuperSonics
        </Typography>
      </Box>

      {/* Render UploadedFiles component with the uploaded files */}
      <UploadedFiles files={uploadedFiles} />
    </Container>
  );
}

export default Home;
